/** 
 * Displays the undo checkout confirmation dialog for each checked out file and then  undoes the checkout while keeping a copy of the working version of the file if the  user chooses to do so.<br> All unmodified checkouts will be undone. Only modified checkouts the user chooses will be undone.
 * @param unmodifiedCheckOutsList the list of unmodified checked out files
 * @param modifiedCheckOutsList the list of checked out files that have been modified
 */
private void undoCheckOuts(List<DomainFile> unmodifiedCheckOutsList,List<DomainFile> modifiedCheckOutsList){
  boolean saveCopy=false;
  DomainFile[] files=new DomainFile[0];
  boolean undoWasCancelled=false;
  if (modifiedCheckOutsList.size() > 0) {
    UndoActionDialog dialog=new UndoActionDialog("Confirm Undo Checkout",resources.ResourceManager.loadImage("images/vcUndoCheckOut.png"),"UndoCheckOut","checkout",modifiedCheckOutsList);
    int actionID=dialog.showDialog(tool);
    if (actionID != UndoActionDialog.CANCEL) {
      saveCopy=dialog.saveCopy();
      files=dialog.getSelectedDomainFiles();
    }
 else {
      undoWasCancelled=true;
    }
  }
  if ((unmodifiedCheckOutsList.size() > 0) || (files.length > 0)) {
    tool.execute(new UndoCheckOutTask(unmodifiedCheckOutsList,files,saveCopy));
  }
  if (undoWasCancelled) {
    tool.setStatusInfo("Undo check out was canceled");
  }
}
